class Solution {
  int countSubMultisets(List<int> nums, int l, int r) {
    const int mod = 1000000007;
    int maxElement = 20001; // Given constraint +1 for 0-based indexing
    List<int> freq = List.filled(maxElement, 0);
    for (int num in nums) {
      freq[num]++;
    }

    List<List<int>> dp = List.generate(nums.length + 1, (_) => List.filled(maxElement, 0));
    dp[0][0] = 1; // Base case: there's one way to make sum 0 with 0 elements

    for (int i = 1; i <= nums.length; i++) {
      dp[i][0] = (dp[i - 1][0] * 2) % mod; // Empty set and every element can be included or not
      for (int sum = 1; sum < maxElement; sum++) {
        dp[i][sum] = dp[i - 1][sum]; // Exclude current element
        if (sum - nums[i - 1] >= 0) {
          dp[i][sum] = (dp[i][sum] + dp[i - 1][sum - nums[i - 1]]) % mod; // Include current element
        }
      }
    }

    int result = 0;
    for (int sum = l; sum <= r; sum++) {
      result = (result + dp[nums.length][sum]) % mod;
    }
    return result;
  }
}
